import React from "react";

const Cards = ({ productos }) => {
  return (
    <div className="flexC">
      {productos.map((x) => (
        <div className="card">
          <img alt={x.img} src={x.img}></img>
          <h2 className='name'></h2>
          <h3 className='price'>{x.price}</h3>
        </div>
      ))}
    </div>
  );
};

export default Cards;
